const item = items[0].json;

const outputString = item.output;
const startIndex = outputString.indexOf('{');
const endIndex = outputString.lastIndexOf('}');

let jsonData = { error: "Could not find JSON in the input string" };

  if (startIndex !== -1 && endIndex !== -1) {
    // Extract the JSON string
    const jsonString = outputString.substring(startIndex, endIndex + 1);

    try {
      // Parse the string into a real JSON object
      jsonData = JSON.parse(jsonString);
    } catch (error) {
      jsonData = { error: "Failed to parse JSON", details: error.message };
    }
  }

  // Return the extracted JSON object for the next node in the workflow.
  // n8n expects an array of items to be returned.
  return [
    {
      json: jsonData
    }
  ];
